import React, { Component } from 'react';
import Main from './components/main/Main';
import logo from './logo.svg';
import './App.css';
import { Button } from 'semantic-ui-react'
import { Image as ImageComponent, Item } from 'semantic-ui-react'

const paragraph = <ImageComponent src='/src/images/short-paragraph.png' />

class App extends Component {
  render() {
    return (
      <div className="App">
      <Button>Click Here</Button>
        {/* <Main/> */}

        <Item.Group link>
          <Item>
            <Item.Image size='tiny' src='live-from-space.jpg' />

            <Item.Content>
              <Item.Header>Stevie Feliciano</Item.Header>
              <Item.Description>{paragraph}</Item.Description>
            </Item.Content>
          </Item>

          <Item>
            <Item.Image size='tiny' src='/images/live-from-space.jpg' />

            <Item.Content>
              <Item.Header>Veronika Ossi</Item.Header>
              <Item.Description>{paragraph}</Item.Description>
            </Item.Content>
          </Item>

          <Item>
            <Item.Image size='tiny' src='/images/live-from-space.jpg' />

            <Item.Content>
              <Item.Header>Jenny Hess</Item.Header>
              <Item.Description>{paragraph}</Item.Description>
            </Item.Content>
          </Item>
        </Item.Group>

      </div>


    );
  }
}

export default App;
